import React, { useEffect, useState } from 'react';
import './UserProfile.css';

const UserProfile = ({ token }) => {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const apiUrl = process.env.REACT_APP_API_URL || 'http://localhost:8000';
    const realToken = token || localStorage.getItem('token');
    if (!realToken) {
      setError('Not logged in');
      setLoading(false);
      return;
    }
    setLoading(true);
    fetch(`${apiUrl}/api/user/profile`, {
      headers: { 'Authorization': `Bearer ${realToken}` }
    })
      .then(res => res.json())
      .then(data => {
        if (data.success) setUser(data.user);
        else setError(data.message || 'Failed to load user profile');
        setLoading(false);
      })
      .catch(() => {
        setError('Failed to load user profile');
        setLoading(false);
      });
  }, [token]);

  if (!token) return <div className="user-profile"><p>Please log in to view your profile.</p></div>;
  if (loading) return <div className="user-profile"><p>Loading profile...</p></div>;
  if (error) return <div className="user-profile"><p style={{color:'#dc2626'}}>{error}</p></div>;

  return (
    <div className="user-profile">
      <div className="profile-header">
        <div className="profile-avatar">
          {/* Use first letter of username or fallback */}
          {user.firstName?.[0]?.toUpperCase() || user.username?.[0]?.toUpperCase() || "U"}
        </div>
        <div className="profile-title">
          <h2>{user.firstName} {user.lastName}</h2>
          <span className="profile-role">{user.role === 'admin' ? 'Administrator' : 'Customer'}</span>
        </div>
      </div>
      <div className="profile-details">
        <div><span className="profile-icon">üë§</span><strong>Username:</strong> {user.username}</div>
        <div><span className="profile-icon">üìß</span><strong>Email:</strong> {user.email}</div>
        <div><span className="profile-icon">üßë</span><strong>First Name:</strong> {user.firstName}</div>
        <div><span className="profile-icon">üßë</span><strong>Last Name:</strong> {user.lastName}</div>
        <div><span className="profile-icon">üõ°Ô∏è</span><strong>Role:</strong> {user.role}</div>
        <div><span className="profile-icon">üìÖ</span><strong>Joined:</strong> {new Date(user.createdAt).toLocaleDateString()}</div>
      </div>
    </div>
  );
};

export default UserProfile;
